import Container from "react-bootstrap/esm/Container";
import Form from "react-bootstrap/Form";

export default function SignInForm() {
  return;
  <Container>
    <Form>
      <header className="mb-5">
        <h1 className="text-center">Sign In</h1>
      </header>
    </Form>
    ;
  </Container>;
}
